import React from "react";
import SHOP_DATA from "./2.2_shop.data.js";
import CollectionPreview from "../../../components/collection-preview/collection-preview.component.jsx";'../../../components/collection-preview/collection-preview.component.jsx';


class ShopPage extends React.Component{
    constructor(props){
        super(props);
        
        this.state = {
            collection : SHOP_DATA
        };
    }
    render(){
        const {collections} = this.state;
        return <div className="shop-page">
            {
                collections.map
            }
        </div>
    }
}

export default ShopPage;
